import React from "react";
import logo5 from "./logo.svg";
import { Menu, Row, Col, Input, Icon } from "antd";
import logo from "./icons8-notification-64.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="menuBar">
        <div className="logo">
          <a href="">
            <Icon component={logo} />
            Push Notification
          </a>
        </div>
      </div>
    </div>
  );
}

export default App;
